import "./App.css";
import Follower from "./Follower";
import { useFetch } from "./useFetch";

function App() {
  const { loading, data } = useFetch();

  return (
    <div className="App">
      <h1>{loading ? "loading..." : "pagination"}</h1>
      <div className="followers">
        {data.map((follower) => {
          return <Follower key={follower.id} {...follower} />;
        })}
      </div>
    </div>
  );
}

export default App;
